describe("simpleQueryString()",function(){"use strict";it("exists",function(){expect(simpleQueryString).to.be.a("object")}),it("parse validation: empty",function(){expect(simpleQueryString.parse("")).to.be.a("object"),expect(simpleQueryString.parse()).to.be.a("object"),expect(simpleQueryString.parse(null)).to.be.a("object")}),it("parse validation: full url without query string",function(){var e=simpleQueryString.parse("http://example.org");expect(e).to.be.a("object"),expect(_.keys(e).length).to.equal(0),e=simpleQueryString.parse("http://example.org/teste"),expect(e).to.be.a("object"),expect(_.keys(e).length).to.equal(0),e=simpleQueryString.parse("//example.org/teste"),expect(e).to.be.a("object"),expect(_.keys(e).length).to.equal(0),e=simpleQueryString.parse("//example.org/teste#anchor"),expect(e).to.be.a("object"),expect(_.keys(e).length).to.equal(0)}),it("parse validation: with anchor",function(){var e=simpleQueryString.parse("http://example.org?var=val#anchor");expect(e["var"]).to.equal("val")}),it("parse validation: with anchor partial url",function(){var e=simpleQueryString.parse("var=val#anchor");expect(e["var"]).to.equal("val")}),it("parse validation: parameters as array",function(){var e=simpleQueryString.parse("my=1&my=2&k1=v1&my=3&my=4");expect(e.k1).to.equal("v1"),expect(e.my.length).to.equal(4),expect(e.my[2]).to.equal("3")}),it("stringify validation: array",function(){var e=simpleQueryString.stringify({my:[1,2,3,4]});expect(e).to.equal("my=1&my=2&my=3&my=4")}),it("stringify validation: boolean",function(){var e=simpleQueryString.stringify({p1:!0,p2:!1});expect(e).to.equal("p1=true&p2=false")})});